ALTER TABLE order_item
ADD COLUMN status enum('pending','cancel','finished','ready','inprocess','ordering') NULL AFTER quantity;

CREATE TABLE group_item (
id int NOT NULL AUTO_INCREMENT ,
value varchar(2048) NULL ,
type varchar(32) NULL ,
created_at datetime NULL ,
PRIMARY KEY (id)
);
ALTER TABLE group_item
ADD COLUMN business_id int NULL AFTER type,
ADD COLUMN product_id int NULL AFTER business_id
ADD COLUMN status enum('pending','cancel,'finished','ready','inprocess','ordering') NULL DEFAULT 'ordering' AFTER type;
